import React, { useState } from "react";

const Search =()=>{
    var [ser,setser]=useState('');

    const inset=(val)=>{
        const data=val.target.value;
        setser(data);
    }

    const getser=()=>{
        console.log(ser);
    }

    return(
        <div className="search">
            <input type="text"
             placeholder="type anything" 
             value={ser} 
             onChange={inset}>
             </input>
             <button onClick={getser}>click me</button>
        </div>
    );
}

export default Search;
